import NavBar from "../components/layout/navBar";
import classes from './Home.module.css';
import PostImage from '../assets/images/post.png';
import BackgroundPattern from '../assets/images/pearLogoPattern.svg';

function Home() {
  return (
    <div>
      <NavBar />
      <div className={classes.header} style={{backgroundImage: `url(${BackgroundPattern})`}}>
        <div className={classes.headerLeft}>
          <div className={classes.headerLeftContainer}>
            <h1 className={classes.headTitle}>Pear Programming</h1>
            <p className={classes.headDesc}>A place for designers and developers to share ideas, find inspiration, and work together to build their skills and resumes.</p>
          </div>
        </div>
        <div className={classes.headerRight}>
          <img src={PostImage}/>
        </div>
      </div>
    </div>
  );
}

export default Home;
